import { Tab, TabList, TabPanel, Tabs } from "react-tabs";
import './Home.css';

function Camiones() {
    return (
        <Tabs>
        <TabList >
          <Tab className="nav-item is-active">Title 1</Tab>
          <Tab>Title 2</Tab>
        </TabList>
    
        <TabPanel>
          <h2>Any content 1</h2>
        </TabPanel>
        <TabPanel>
          <h2>Any content 2</h2>
        </TabPanel>
      </Tabs>
      );
}

export default Camiones;
